// css files
import './App.css';
import "../src/css/rsmenu.css";
import "../src/img/logo.svg";
import "../src/Styles.css";
import '../src/css/rsspacing.css';
import '../src/css/responsive.css';
import '../src/css/animate.css';
import '../src/css/magnific-popup.css';
import '../src/css/off-canvas.css';
import '../src/css/owl.carousel.css';
import '../src/css/slick.css';

// Js files
import './js/jquery.min.js';
import '../src/js/particles.min.js';
import '../src/js/wow.min.js';
import '../src/js/pointer.js';

// react components
import Header from './Components/Header';
import Barnner from './Components/Barnner';
import Services from './Components/Services';
import About from './Components/About';
import Counter from './Components/Counter';
import Product from './Components/Product';
import Testimonial from './Components/Testimonial';
import Start from './Components/Start';
import Footer from './Components/Footer';
import { BrowserRouter, Route } from 'react-router-dom';


function App() {
  return (

    <div className="App">
      <BrowserRouter>
      <Header />
      <Barnner/>
      <Services/>
      <Know/>
      <Counter/>
      <Product/>
      <Testimonial/>
      <Start/>
      <Footer/>
      <Route path="/">
        <Home/>
      </Route>
      <Route path="/about">
        <About/>
      </Route>
      <Route path="/login">
        <Login/>
      </Route>
      <Route path="/signup">
        <Join/>
      </Route>
      </BrowserRouter>
    </div>
  );
}

export default App;
